/**
 * Dependencies
 */

import uuid from 'uuid';
import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import { PrivateRoute } from './helpers/index';
import {
  Home,
  ErrorBoundary,
  } from '../views/index';

/**
 * Define router
 */

const UserRoutes = [
    <PrivateRoute key={uuid.v4()} exact path='/home'
    component={Home}
    />

];

/**
 * Export router
 */

export default UserRouter;
